using MarketPlace.Core;
using MarketPlace.Core.Model;
using MarketPlace.Core.ParameterBindings;
using MarketPlace.Models;
using System;
using System.Collections.Generic;
using System.Configuration;
using System.Linq;
using System.Net;
using System.Net.Http;
using System.Web.Http;
using System.Web.Services.Description;

namespace MarketPlace.Controllers
{
    public class ProductsController : ApiController
    {
        private readonly IMarketPlaceService _marketPlaceService;

        public ProductsController()
        {
            string connectionString = ConfigurationManager.ConnectionStrings["Database"].ConnectionString;
            this._marketPlaceService = new MarketPlaceService(new ProductRepository(connectionString));
        }

        [HttpPost]
        public HttpResponseMessage AddCategory([FromBody] ProductCategoryViewModel productViewModel)
        {
            this._marketPlaceService.ProductCategoryAdd(productViewModel.Code, productViewModel.Name);
            return base.Request.CreateResponse(HttpStatusCode.OK);
        }

        [HttpPost]
        public HttpResponseMessage AddProduct([FromBodyMultipart(ContentType = "application/json")] ProductViewModel productViewModel, 
            [AttachmentParameterBinding] IEnumerable<Attachment> attachments)
        {
            string imageBase64 = "data:image/png;base64,";
            if (attachments.Any<Attachment>())
            {
                imageBase64 = string.Concat("data:image/png;base64,", Convert.ToBase64String(attachments.FirstOrDefault<Attachment>().Data));
            }
            this._marketPlaceService.ProductAdd(productViewModel.Code, productViewModel.Name, productViewModel.Description, productViewModel.UnitPrice, productViewModel.CategoryId, imageBase64);
            return base.Request.CreateResponse(HttpStatusCode.OK);
        }

        [HttpGet]
        public IEnumerable<ProductCategory> ProductCategoryList()
        {

            return this._marketPlaceService.ProductCategoryList();
        }

        [HttpGet]
        public IEnumerable<Product> ProductList()
        {
            return this._marketPlaceService.ProductList();
        }


